import React, { Component } from 'react';
import Link from "next/link";
import styles from "./navbar.module.css";
import { showDiv } from '../lib/menu'

const Menu = [
    {
      path: "/blog", name: "Blog",
    },
    {
      path: "/#", name: "100DaysofCode",
    },

    ]
    const openNav = () => {
        console.log("this.state")
      this.setState({
          mobile_Menu : true
      }) };

class NavBarState extends Component {
state = {
    mobile_Menu : false
};

    render() {
        return (
            <header className={styles.header_Wrapper}>
            <div className={styles.div_top_hypers}>
              <div className={styles.logo_left}>NdV</div>
              <ul className={styles.ul_top_hypers}>
               {Menu.map(({path, name}) => (
                <li key={name}>
                  <Link href={path} as={path}>
                    <a>{name}</a>
                  </Link>
                </li>

               ))} 
                </ul>
                 </div>
                 <div className={styles.menu_right}><Link href={"#"}><button onClick={() => {openNav}}><i className="fa fa-bars"></i></button></Link></div>
                 {this.mobile_Menu ? <div className={styles.menu_mobile}> 
                   {Menu.map(({path, name}) => (
                <li key={name}>
                  <Link href={path} as={path}>
                    <a>{name}</a>
                  </Link>
                </li>))}
                </div> : null}
            </header>
        );
    }
}

export default NavBarState;
